  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains chlorophyll and
  phaeophytin measurements made innthe Georges Bank, Gulf of Maine, and middle Atlantic
  Shelf areas betweenn1978-1982. The data were submitted by J.E. O'Reilly at NortheastnFisheries
  Center, Sandy Hook Laboratory. Reference numbers for this datanset range from L00790
  TO L00796. The different reference numbersnrepresent different ships and cruise
  dates. The ships used in this studynwere: Advance II, Albatross, Belogorsk (Russian),
  Delaware, Evrikan(Russian), Kelez and Wieczno (Polish). A separate file \"Read.
  me\"ndescribes the format for the data.\",\n\t\"license_title\": null,\n\t\"extras\":
